import React from "react"
import {useForm} from "react-hook-form";

const SignUp = React.forwardRef(({ style, setLoginDetails,...rest }, ref) => {

    const styles = {
      ...style,
      background: 'white',
      width: "20rem",
      height: "23rem",
      padding: 15,
      borderRadius: 4,
      border:"1px solid #407BC4",
      position: 'absolute',
      boxShadow: '0 3px 6px -2px rgba(0, 0, 0, 0.6)',
      marginLeft: "-10%",
      marginTop: "-10%"
    };

    const {register, handleSubmit} = useForm()
    const  submiteHandler = (data) =>{
        setLoginDetails(data)
    }

    return (
      <div {...rest} style={styles} ref={ref}>
        <h2>Create an Account</h2>
        <form
            style={{
                display: "flex",
                flexFlow: "column"
            }} 
            onSubmit={handleSubmit(submiteHandler)}
        >
            <input
                className="formInput"
                placeholder="Name"
                type="text"
                name="name"
                ref={register}
            />
            <input
                className="formInput"
                placeholder="email"
                type="email"
                name="email"
                ref={register}
            />
            <input
                className="formInput"
                placeholder="password"
                type="password"
                name="password"
                ref={register}
            />
            <input
                className="formInput"
                placeholder="password again"
                type="password"
                name="secondPassword"
                ref={register}
            />
            <button className="primaryButton">Register</button>
        </form>
      </div>
    );
  });

export default SignUp
